        document.addEventListener('DOMContentLoaded', function() {
            const widthInput = document.getElementById('palleon-resize-width');
            const heightInput = document.getElementById('palleon-resize-height');
            const selectTag = document.getElementById('palleon-size-select');
            const optionTag = document.createElement('option');
            optionTag.value = 'custom';
            optionTag.innerText = `Custom`;
            selectTag.appendChild(optionTag);
            for(let size of window.POST_SIZES) {
                const optionTag = document.createElement('option');
                optionTag.value = size.size;
                optionTag.innerText = `${size.title} ${size.size}`;
                selectTag.appendChild(optionTag);
            }

            //********** HANDLE SIZE SELECT EVENT **********//
            selectTag.addEventListener('change', function(event) {
                if(event.target.value === 'custom') {
                    widthInput.readOnly = false;
                    heightInput.readOnly = false;
                } else {
                    widthInput.readOnly = true;
                    heightInput.readOnly = true;
                }
            });


            //****************** setting fontsize *********************//
            $('html').css('font-size', $('#custom-font-size').val() + 'px');

        });


